    const saveExpenseDataHandler = (entereredData) =>{
        const expanData = {
            ...entereredData,
            id: Math.random().toString()
        } 

        props.onArrayData()
        console.log(expanData);
        
    }
    return (
        <div className="new-expense">
            <ExpenseForm 
            onSaveExpenseData = {saveExpenseDataHandler}/>
        </div>
    );


}

